import React from "react";
import {
  Icon,
  CloseIcon,
  SidebarContainer,
  SidebarMenu,
  SidebarLink,
  SidebarWrapper,
} from "./SidebarElement";

const Sidebar = () => {
  return (
    <SidebarContainer>
      <Icon>
        <CloseIcon />
      </Icon>
      <SidebarWrapper>
        <SidebarMenu>
          <SidebarLink to="about">About Me</SidebarLink>
        </SidebarMenu>
        <SidebarMenu>
          <SidebarLink to="Portfolio">Portfolio</SidebarLink>
        </SidebarMenu>
        <SidebarMenu>
          <SidebarLink to="ContractMe">Contract Me</SidebarLink>
        </SidebarMenu>
        <SidebarMenu>
          <SidebarLink to="Needin">Need My Resume?</SidebarLink>
        </SidebarMenu>
      </SidebarWrapper>
    </SidebarContainer>
  );
};
export default Sidebar;
